import React from "react";
import cl from "./ContentMicrodata.module.css";

const ContentMicrodata = () => {
  return (
    <div className={cl.microdataContainer}>
      <h2 className={cl.microdataHead}>
        Устранение неполадок с сетью в Windows
      </h2>
      <div className={cl.microdataAticleContainer}>
        <p>
          Для решения большинства компьютерных проблем можно самостоятельно
          найти ответы в справке и поддержке Windows. Далее представлены
          некоторые указатели по справке для конкретных типов неполадок.
        </p>
        <div className={cl.microdataArticleListContainer}>
            <p>При работе в сети чаще всего возникают следующие ошибки:</p>
            <ul className={cl.microdataArticleList}>
                <li className={cl.microdataArticleListElement}>- неполадки при обнаружении беспроводных сетей.</li>
                <li className={cl.microdataArticleListElement}>- неполадки при обнаружении компьютеров домашней сети.</li>
                <li className={cl.microdataArticleListElement}>- неполадки с сетью и подключением к Интернету.</li>
            </ul>
        </div>
      </div>
    </div>
  );
};

export default ContentMicrodata;
